//	Initialize the controller, and draw the
//	game menu.
//
//************************************************

.globl initGame
initGame:
       	ldr r1, =state
	mov r0, #4
	str r0, [r1, #8]
	bl	InitFrameBuffer
	bl      InitController
	bl	GameMenu

menuLoop:
	ldr	r0, =number
	ldr	r0, [r0]
	bl	Wait

	cmp	r0, #8
	beq	selected

	cmp	r0, #4
	bleq	switchPointer
	cmp	r0, #5
	bleq	switchPointer		

	b	menuLoop
        
selected:
	ldr	r0, =PointerPos
	ldr	r0, [r0]
	cmp	r0, #676
	bne	start1
	mov	r0,#0x0000
	bl	drawBackground
	b	haltLoop$



