start1:
	ldr	r0, =randomNumberdoor
	mov	r1, #0
	str	r1, [r0]
	str	r1, [r0, #4]

	ldr	r0, =state
	str	r1, [r0, #12]

	ldr	r0, =counter
	str	r1, [r0]
	ldr	r0, =full
	ldr	r1, [r0]
	ldr	r0, =number
	str	r1, [r0]

	bl		InitBackGround		//draw game world background
	bl		InitWall		//draw the walls in the game world

        bl              snakeMove		//begin moving the snake
	
	


haltLoop$:
	b	haltLoop$


