//*******************************************
//
//	Draws a colour, passed into the 
//	subroutine, the size of the screen
//
//*******************************************

.globl drawBackground
drawBackground:
	push	{r4-r6, lr}
	px	.req	r4
	py	.req	r5
	
	mov	r6, r0
        mov	px, #0
        mov	py, #0
BYLoop:
        cmp	py, #768
        bge	BYDone

BXLoop: 
        cmp	px, #1024
        bge	BXDone

        mov	r0, px
        mov     r1, py	    
        mov	r2, r6
	bl	DrawPixel
	add	px, #1
        b	BXLoop

BXDone:
	mov	px, #0
	add	py, #1
	b	BYLoop
   
BYDone:
	.unreq	px
	.unreq	py
	pop	{r4-r6,pc}


//*******************************************************
//
//	Draw a character to the screen.
//
//*******************************************************

.globl drawChar
drawChar:
	push	{r4-r10, lr} 
	chAdr	.req	r4
	px	.req	r5
	py	.req	r6
	row     .req	r7
	mask    .req	r8
	x	.req	r9
	y	.req	r10
	
	mov	x, r1
	mov	y, r2
	ldr	chAdr, =font		// load the address of the font map
	add	chAdr, r0, lsl #4	// char address = font base + (char * 16)

	mov	py, y			// init the Y coordinate (pixel coordinate)

charLoop:
	mov	px, x			// init the X coordinate

	mov	mask, #0x01		// set the bitmask to 1 in the LSB
	
	ldrb	row,	[chAdr], #1	// load the row byte, post increment chAdr

rowLoop:
	tst	row, mask		// test row byte against the bitmask
	beq	noPixel

	mov	r0, px
	mov	r1, py
	mov	r2, #0xF800		// red
	bl	DrawPixel		// draw red pixel at (px, py)

noPixel:
	add	px, #1			// increment x coordinate by 1
	lsl	mask, #1		// shift bitmask left by 1

	tst	mask, #0x100		// test if the bitmask has shifted 8 times (test 9th bit)
	beq	rowLoop

	add	py, #1			// increment y coordinate by 1

	tst	chAdr, #0xF
	bne	charLoop	// loop back to charLoop$, unless address evenly divisibly by 16 (ie: at the next char)

	.unreq	chAdr
	.unreq	px
	.unreq	py
	.unreq	row
	.unreq	mask

	pop	{r4-r10, pc}






