//use the controller to move the snake     
stop:
	ldr	r0, =number
	ldr	r0, [r0]
	bl	Wait
	
	cmp	r0, #3
	beq	pauseMenu
	cmp	r0, #4
	beq	Up
	cmp	r0, #5
	beq	Down
	cmp	r0, #7
	beq	Right
	b	stop 
.globl Up       // let the snake to move up
Up:
        bl      upbody
        bl      upwall
	bl	moveUp

	ldr	r0, =number
	ldr	r0, [r0]
	bl	Wait

	cmp	r0, #3  	 	//start was pressed
	beq	pauseMenu
	cmp	r0, #6			//left-direction was pressed
	beq	Left
	cmp	r0, #7			//right-direction was pressed
	beq	Right
	b	Up			//keep going up
.globl Left
Left:
        bl      leftbody
        bl      leftwall
	bl	moveLeft

	ldr	r0, =number
	ldr	r0, [r0]
	bl	Wait

	cmp	r0, #3			//start was pressed
	beq	pauseMenu
	cmp	r0, #4			//up-direction was pressed
	beq	Up
	cmp	r0, #5			//down-direction was pressed
	beq	Down
	b	Left			//keep going left
.globl Right
Right:
        bl      rightbody
        bl      rightwall
	bl	moveRight
	
	ldr	r0, =number
	ldr	r0, [r0]
	bl	Wait

	cmp	r0, #3			//start was pressed
	beq	pauseMenu
	cmp	r0, #4			//up-direction was pressed
	beq	Up
	cmp	r0, #5			//down-direction was pressed
	beq	Down
	b	Right			//keep going right
.globl Down
Down:
        bl      downbody
        bl      downwall
	bl	moveDown

	ldr	r0, =number
	ldr	r0, [r0]
	bl	Wait

	cmp	r0, #3			//start was pressed
	beq	pauseMenu
	cmp 	r0, #6			//left-direction was pressed
	beq	Left
	cmp	r0, #7			//right-direction was pressed
	beq	Right
	b	Down			//keep going down

        
        
                
      	.unreq	px
	.unreq	py
        .unreq bodylength   
	pop     {r4-r12, pc}






//*******************************************************
//
//	Draws a cell.  X, Y and colour are passed 
//	as parameters.
//
//*******************************************************

.globl     drawCell
drawCell:
	push	{r4-r10, lr}
	px	.req	r8
	py	.req	r9
	color	.req	r10
	mov	px, r0
	mov	py, r1
	mov	color, r2
        mov     r4, #0
        mov     r5, #0
vloop:
        cmp     r5, #32
        bge     donev

hloop:     
        cmp     r4, #32
        bge     doneh
        add     r0, r4, px
        add     r1, r5, py
	ldrh	r2, [color]
	bl	DrawPixel			
        add     r4, #1
	add     color, #2
        b       hloop
doneh:
        add             r5, #1
	mov		r4, #0
        b               vloop

donev:
	.unreq	px
	.unreq	py
	.unreq	color
	pop     {r4-r10, pc}






//*************************************************
//
//	Draws a cell-sized colour.  X, Y and colour
//	are passed as parameters.
//
//*************************************************

.globl     drawColour
drawColour:
	push	{r4-r10, lr}
	px	.req	r8
	py	.req	r9
        color   .req    r10
	mov	px, r0
	mov	py, r1
        mov     color, r2
        mov     r4, #0
        mov     r5, #0
vertloop:
        cmp     r5, #32
        bge     donevert

horizloop:     
        cmp     r4, #32
        bge     donehoriz
        add     r0, r4, px
        add     r1, r5, py
        mov     r2, color	
	bl	DrawPixel			
        add     r4, #1
        b       horizloop
donehoriz:
        add             r5, #1
	mov		r4, #0
        b               vertloop

donevert:
	.unreq	px
	.unreq	py
        .unreq  color
	pop     {r4-r10, pc}

.globl	Wait
Wait:						// Wait certain amount of time
	push	{r4-r5, lr}
	mov	r4, r0
	
	ldr	r0, =counter
	ldr	r1, [r0]
	add	r1, #1
	str	r1, [r0]
	
	cmp	r1, #320
	ble	noChange
	ldr	r0, =half
	ldr	r1, [r0]
	ldr	r0, =number
	str	r1, [r0]

noChange:
	ldr	r0, =0x20003004 		// address of CLO
	ldr	r1, [r0] 			// read CLO
	add	r4, r1, r4			// add some microseconds
waitLoop:
	bl	readInput
	mov	r5, r0
	ldr	r0, =0x20003004 		// address of CLO
	ldr	r2, [r0]
	cmp	r4, r2 				// stop when CLO = r1
	bhi	waitLoop
	mov	r0, r5
	pop	{r4-r5, pc}


